import React from 'react';
import { useNavigate } from 'react-router-dom';
import { Search, ArrowLeft, Clock, MapPin, X } from 'lucide-react';

const Events = ({ events, theme, searchTerm, setSearchTerm }) => {
  const navigate = useNavigate();
  const isDark = theme === 'dark';

  // Dynamic colors based on global theme
  const colors = {
    background: isDark ? '#0f172a' : '#f8fafc',
    cardBg: isDark ? '#1e293b' : '#ffffff',
    textPrimary: isDark ? '#ffffff' : '#1e293b',
    textSecondary: isDark ? '#94a3b8' : '#64748b',
    border: isDark ? '#334155' : '#f1f5f9',
    primaryBlue: '#2563eb'
  };

  const styles = {
    container: { 
      padding: '16px', 
      backgroundColor: colors.background, 
      minHeight: '100vh',
      color: colors.textPrimary,
      paddingBottom: '100px'
    },
    header: { 
      display: 'flex', 
      alignItems: 'center', 
      gap: '12px', 
      marginBottom: '20px',
      position: 'sticky',
      top: 0,
      backgroundColor: colors.background,
      zIndex: 10,
      padding: '10px 0'
    },
    searchBar: {
      flex: 1,
      display: 'flex',
      alignItems: 'center',
      backgroundColor: isDark ? '#1e293b' : '#fff',
      padding: '8px 12px',
      borderRadius: '24px',
      border: `1px solid ${colors.border}`
    },
    input: {
      flex: 1,
      border: 'none',
      backgroundColor: 'transparent',
      color: colors.textPrimary,
      outline: 'none',
      marginLeft: '8px',
      fontSize: '14px'
    },
    eventCard: {
      backgroundColor: colors.cardBg,
      borderRadius: '20px',
      overflow: 'hidden',
      marginBottom: '16px',
      border: `1px solid ${colors.border}`,
      boxShadow: isDark ? 'none' : '0 4px 6px -1px rgba(0,0,0,0.05)'
    },
    imageArea: {
      height: '160px',
      backgroundColor: isDark ? '#2d3748' : '#e2e8f0',
      backgroundSize: 'cover',
      backgroundPosition: 'center'
    },
    details: { padding: '16px' },
    title: { fontSize: '18px', fontWeight: 'bold', margin: '0 0 8px 0', color: colors.textPrimary },
    infoRow: { display: 'flex', alignItems: 'center', gap: '6px', fontSize: '13px', color: colors.textSecondary, marginBottom: '4px' },
    registerBtn: {
      width: '100%',
      padding: '12px',
      backgroundColor: colors.primaryBlue,
      color: '#fff',
      border: 'none',
      borderRadius: '12px',
      fontWeight: 'bold',
      marginTop: '12px',
      cursor: 'pointer'
    }
  };

  return (
    <div style={styles.container}>
      {/* Header with Search */}
      <div style={styles.header}>
        <ArrowLeft 
          size={24} 
          onClick={() => navigate(-1)} 
          style={{ cursor: 'pointer', color: colors.textPrimary }} 
        />
        <div style={styles.searchBar}>
          <Search size={18} color={colors.textSecondary} />
          <input 
            style={styles.input} 
            placeholder="Search events..." 
            value={searchTerm}
            onChange={(e) => setSearchTerm(e.target.value)}
          />
          {searchTerm && (
            <X 
              size={18} 
              color={colors.textSecondary} 
              onClick={() => setSearchTerm("")} 
              style={{ cursor: 'pointer' }} 
            />
          )}
        </div>
      </div>

      <h2 style={{ marginBottom: '16px', fontSize: '20px', color: colors.textPrimary }}>
        Upcoming Events
      </h2>

      {/* Event List Rendering */}
      {events.length > 0 ? (
        events.map(event => (
          <div key={event.id} style={styles.eventCard}>
            <div style={{...styles.imageArea, backgroundImage: `url(${event.image})` }} />
            <div style={styles.details}>
              <h3 style={styles.title}>{event.title}</h3>
              <div style={styles.infoRow}><Clock size={14} /> {event.date}</div>
              <div style={styles.infoRow}><MapPin size={14} /> {event.location}</div>
              
              {/* Working Register Button */}
              <button 
                style={styles.registerBtn} 
                onClick={() => alert(`Successfully registered for ${event.title}!`)}
              >
                Register Now
              </button>
            </div>
          </div>
        ))
      ) : (
        <div style={{ textAlign: 'center', marginTop: '40px', color: colors.textSecondary }}>
          No events found for "{searchTerm}"
        </div>
      )}
    </div>
  );
};

export default Events;
